import React from 'react';
import background from '../../images/background.png';

const Hero = () => {
  return (
    <div id="hero" className="hero">
      <div className="content">
      </div>
      <div className="overlay" style={{background: `url(${background})`}}/>
    </div>
  )
}

export default Hero
